/**
 * @typedef {string} csatStatus
 */

/**
 * An enum of possible csat statuses
 * @enum {csatStatus}
 */
const csatStatus = {
    /** Default value when csat is updated **/
    FILLED: 'FILLED',
    PARTIALLY_FILLED: 'PARTIALLY_FILLED',
    SKIPPED: 'SKIPPED',
    EMPTY: 'EMPTY'
};

module.exports = csatStatus;
